import React from 'react';
import "../css/PropiedadHome.css";
import { Link } from "react-router-dom";


function PropiedadHome(props) {
  return (
    <Link to={"/Details/"+ props.id}  state={{ props }}>
    <div className={props.alquilada ? 'contenedor-propiedad-home alquilada' : 'contenedor-propiedad-home'}>
      <img 
        className='imagen-propiedad'
        src={require(`../images/${props.image}.png`)}
        alt={"Imagen de Propiedad " + props.name}/>
      <div className='contenedor-texto-propiedad'>
        <h2 className='nombre-propiedad'>
          <strong>{props.name}</strong> en {props.direction}
        </h2>
        <div className='row'>
          <h1 className='precio-propiedad'>
             <strong>{props.price} USD</strong>
          </h1>
          <h2>
          + {props.expensas} expensas
          </h2>
          <p className='operacion-propiedad'>{props.operation}</p>
        </div>
        <div className='row'>
          <p><strong>{props.ambients}</strong> ambientes</p>
          <p><strong>{props.m2}</strong> m2 cubiertos</p>
        </div>
      </div>
    </div>
    </Link>
  );
}

export default PropiedadHome;
